function Services() {
    return (
      <div style={{ padding: '20px', backgroundColor: '#d0d0d0' }}>
        <h1 style={{ color: '#333' }}>Our Services</h1>
        <ul style={{ listStyleType: 'none', padding: 0 }}>
          <li>Technology Consulting</li>
          <li>Market Analysis</li>
          <li>Product Development</li>
        </ul>
      </div>
    );
  }
